Haar hele leven heeft Casey Beldon (Odette Yustman) haar moeder gehaat, vanwege het feit dat ze haar op jonge leeftijd heeft 
verlaten. Maar als Casey geteisterd wordt door nachtmerries en achtervolgd wordt door geesten begint ze langzamerhand te 
begrijpen wat de reden was van haar moeder om dit te doen. Langzaam maar zeker komt ze erachter dat een geest haar lichaam aan 
het overnemen is en moet ze alles doen om dit te stoppen. Haar enige redding lijkt een man genaamd Sendak (Gary Oldman)...:
